import React, { Component } from 'react';
import '../css/app.css';
import JumbotronCmp from './landing/Jumbotron';
import Cards from './landing/Cards';
import PhotoGallery from './landing/PhotoGallery';

const line = {
	width: '1px',
	height: '20px',
	display: 'inline-block'
};

class Landing extends Component {
	render() {
		return (
			<div id="main">
				<div id="content">
					<section>
						<div className="container">
							<JumbotronCmp />
						</div>
					</section>
					<section className="color">
						<div className="container">
							<Cards />
						</div>
					</section>
					<section>
						<div className="row">
							<div class="col s12 m4 l3">
								<h3 className="red-text">24 Hour Emergency Service Available</h3>
								<div>
								<p>
									We strive to be in constant communication with our 
									customers until the job is done. If you have questions 
									or special requests, just drop us a line. To get a free 
									quote, or for emergency service, please contact us at your 
									convenience. We look forward to serving you!
								</p>
								<hr style={line}/>
								</div>
							</div>
							<div class="col s12 m8 l9">
								<PhotoGallery />
							</div>
						</div>
					</section>
				</div>
			</div>
		);
	}
}

export default Landing;
